import React, { useRef } from "react";
import { FaBars, FaTimes } from "react-icons/fa";

function Home() {
  const nav = useRef();
  const showNavbar = () => {
    nav.current.classList.toggle("responsive_nav");
  };
  return (
    <div>
    <header>
      <div className="image-container">
        <img id="doglogo" src="/doglogo.png"></img>
      </div>
  
      <nav className="btn-rightSide" ref={nav}>
        <button className="login">Login</button>
        <button className="signup">Signup</button>
        <button onClick={showNavbar} className="nav-btn nav-close-btn">
          <FaTimes />
        </button>
      </nav>
      <button onClick={showNavbar} className="nav-btn">
        <FaBars />
      </button>
    </header>
    <h1>We care about dogs as much as you do.</h1>
    <h4>Join now to browse through a selection of popular dog breeds and choose your favorite</h4>
    </div>
  );
}

export default Home;
